import React, { Component } from "react";
import {
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";

import UserService from "../services/user.service";

export default class Home extends Component {

  constructor(props) {
    super(props);

    this.state = {
      content: "Bitch"
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      response => {
        this.setState({
          content: response.data
        });
      },
      error => {
        this.setState({
          content:
            (error.response && error.response.data) ||
            error.message ||
            error.toString()
        });
      }
    );
  }

  render() {


    return (
<div id="parent">
 <div class="bgimage">
    <div class="container-fluid">
    <div class="row">
    <div class="col-lg-12 col-md-12 col-sm-12 col-xs-12">

    <div class="banner-text">
    <h3>Welcome to Off Strength Online Workouts</h3>
        <h5>Sign up today to become a member and get access to exclusive workouts and information to take your routine to the next level.</h5>
        <p><a href="/register" class="btn btn-primary btn-large">Sign Up Â»</a></p>
     </div>
      </div>
    </div>
  </div>
</div>

<div id="child">
<div class="card mb-3">
  <div class="row g-0">
    <div class="col-md-4">
      <img src='images/card01.gif'/>
    </div>
    <div class="col-md-8">
      <div class="card-body">
        <h5 class="card-title">Card title</h5>
        <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
        <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
      </div>
    </div>
  </div>
</div>
</div>


</div>
    );
  }
}
